/**
 * Variable info panel component.
 *
 * This component displays a detailed description and related data for the selected variable.
 */
import React, { useState } from "react";
import { ExternalLink } from "lucide-react";
import { useI18n } from "@wordpress/react-i18n";
import parse from "html-react-parser";

// components
import { Button } from "@/components/ui/button";
import Link from "@/components/ui/link";

// other
import { MapInfoData, RelatedCardData } from "@/types/types";
import { useLocaleContext } from "@/context/locale-provider";
import { cn } from "@/lib/utils";

/**
 * VariableDetailsPanel component, displaying details such as description and related data
 * for the selected variable.
 */
const VariableDetailsPanel: React.FC<{ mapInfo: MapInfoData }> = ({ mapInfo }) => {
  const { __ } = useI18n();
  const { locale } = useLocaleContext();

  const { relatedData } = mapInfo;

  // TODO: temporarily using this base64 image until the API provides the actual image
  const defaultThumbnail = 'data:image/svg+xml;base64,';

  return (
    <div className="variable-details-panel max-w-lg">
      <div className="divide-soft-purple divide-y divide-solid p-4">
        <div className="flex justify-between items-start pb-4">
          <div className="flex items-center space-x-4">
            {/* TODO: replace with image from api */}
            <img className="w-16 h-16" src={defaultThumbnail} />
            <div>
              <div className="text-sm text-cdc-black">
                {relatedData?.datasets && relatedData?.datasets?.length > 0 && (
                  relatedData?.datasets[0].title
                )}
              </div>
              <h2 className="text-2xl font-semibold">{mapInfo[locale].title}</h2>
              <div className="text-xs text-neutral-grey-medium">
                {relatedData?.datasets && relatedData?.datasets?.length > 0 && (
                  relatedData?.datasets[0].description
                )}
              </div>
            </div>
          </div>
        </div>

        <div className="py-4">
          <SectionHeading>{__('Description')}</SectionHeading>
          <SectionText content={mapInfo[locale].description} />
        </div>

        <div className="py-4">
          <SectionHeading>{__('Technical description')}</SectionHeading>
          <SectionText content={mapInfo[locale].techDescription} />
        </div>

        {relatedData && relatedData?.sectors?.length > 0 && (
          <div className="py-4">
            <SectionHeading>{__('Relevant sectors')}</SectionHeading>
            <SectionText content={__('Click on one of them to get specific insights for your needs.')} />
            <SectorsArea items={relatedData?.sectors} />
          </div>
        )}

        {relatedData && relatedData?.training?.length > 0 && (
          <div className="py-4">
            <SectionHeading>{__('Relevant trainings')}</SectionHeading>
            <SectionText content={__('To help you get more of our data.')} />
            <RelevantTrainings items={relatedData?.training} />
          </div>
        )}
      </div>
    </div>
  );
}
VariableDetailsPanel.displayName = "VariableDetailsPanel";

/**
 * Custom component for displaying a heading for the panel sections.
 * No need to export this component since it's only used in the main VariableDetailsPanel.
 */
const SectionHeading: React.FC<{
  as?: keyof JSX.IntrinsicElements;
  className?: string;
  children: React.ReactNode;
}> = ({ as: Tag = 'h3', children, className }) => (
  <Tag className={cn('font-semibold text-sm text-dark-purple uppercase mb-2', className)}>
    {children}
  </Tag>
);
SectionHeading.displayName = "SectionHeading";

/**
 * Custom component for displaying content for the panel sections.
 * No need to export this component since it's only used in the main VariableDetailsPanel.
 */
const SectionText: React.FC<{
  content: string;
  className?: string
}> = ({ content, className }) => {
  // parse content to check if it's plain text or html
  const parsedContent = parse(content);

  // base class name for both plain text and html content
  const baseClassName = 'text-sm text-neutral-grey-medium leading-5 space-y-4';

  // then we want to apply specific class names for plain strings and html
  if (typeof parsedContent === 'string') {
    return (
      <p className={cn(baseClassName, 'mb-4 last:mb-0', className)}>
        {parsedContent}
      </p>
    );
  }

  return (
    <div className={cn(baseClassName, '[&>p]:mb-4 [&>p:last-child]:mb-0 [&>p:empty]:hidden', className)}>
      {parsedContent}
    </div>
  );
};
SectionText.displayName = "SectionText";

/**
 * Custom component for displaying relevant trainings for the selected variable.
 * No need to export this component since it's only used in the main VariableDetailsPanel.
 */
const RelevantTrainings: React.FC<{ items: RelatedCardData[] }> = ({ items }) => (
  <ul className="list-disc list-inside text-sm ms-4 marker:text-brand-blue">
    {items.map((item, index: number) => (
      <li key={index}>
        <Button asChild variant="link" className="font-normal text-brand-blue px-0">
          <a href={item.url} className="h-auto">
            {item.title}
          </a>
        </Button>
      </li>
    )
    )}
  </ul>
);
RelevantTrainings.displayName = "RelevantTrainings";

/**
 * Custom component for displaying relevant sectors for the selected variable.
 * No need to export this component since it's only used in the main VariableDetailsPanel.
 */
const SectorsArea: React.FC<{ items: RelatedCardData[] }> = ({ items}) => {
  const [selectedItem, setSelectedItem] = useState(items[0] || null);

  const { __ } = useI18n();

  return (
    <>
      <div className="flex flex-wrap gap-3.5">
        {items.map((item, index: number) => (
          <Button key={index}
                  variant="outline"
                  size="sm"
                  onClick={() => setSelectedItem(item)}
                  className={cn(
                    'font-semibold text-dark-purple tracking-wide uppercase',
                    'border-cold-grey-4 shadow rounded-full',
                    'hover:bg-dark-purple hover:text-primary-foreground',
                    'transition-colors duration-250',
                    selectedItem.title === item.title
                      ? 'bg-dark-purple text-primary-foreground'
                      : '',
                  )}>
            {item.title}
          </Button>
        ))}
      </div>

      {selectedItem && (
        <div className="bg-neutral-grey-light border border-soft-purple p-2 rounded-lg mt-5 mb-2">
          <p className="text-sm font-semibold text-dark-purple">
            <span className="mr-1">{selectedItem.description}</span>
            <Link href={selectedItem.url} icon={<ExternalLink size={12} />} className="text-brand-blue">
              {__('Learn more')}
            </Link>
          </p>
        </div>
      )}
    </>
  )
};
SectorsArea.displayName = "SectorsArea";

export default VariableDetailsPanel;
